import React from "react";
import { connect } from "react-redux";
import { getHists } from "../redux/selectors";

const Balance = ({ newhist }) => (
  <div>{newhist[0].amount}</div>
);

export default connect(state => ({ newhist : getHists(state) }))(Balance);
